import "./style.css";

export default function App() {
  const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];

  return (
    <>
      <div className="mainContainer">
        {/* card */}
        {cards.map((el, i) => (
          <div class="flip-card">
            <div class="flip-card-inner">
              <div class="flip-card-front"></div>
              <div class="flip-card-back"></div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
}
